import React, { Component } from 'react'

export default class Login extends Component {
  render() {
    return (
      <div>
        <h3>Login</h3>
        <label>Email</label>
        <input type="text" onchange={e=>this.Email=e.target.value}/>
        <label>Pass</label>
      </div>
    )
  }
}
